import logo from './logo.svg';
import './App.css';
import { Button } from 'bootstrap';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Showproduct from './components/Showproduct';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Showproduct/>}/>
        <Route path='/' element={<Showproduct/>}/>

        <Route/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
